import React from 'react';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import 'bootstrap/dist/css/bootstrap.min.css';
import Popup from 'reactjs-popup';
import 'reactjs-popup/dist/index.css';


function Login()
{
    return 
    (
    <>
    <div class ="TopNavigation">
      Back To Index
    </div>
    <div id="form-main">
    <div id="form-div">
    <form class="form" id="form1">
      
      <p class="name">
        <input name="name" type="text" class="validate[required,custom[onlyLetter],length[0,100]] feedback-input" placeholder="Title" id="Title" />
      </p>
      
      <p class="email">
        <input name="email" type="text" class="validate[required,custom[email]] feedback-input" id="Categorized" placeholder="Categorized" />
      </p>
      
      <p class="text">
        <textarea name="text" class="validate[required,length[6,300]] feedback-input" id="comment" placeholder="Comment"></textarea>
      </p>
      
      
      <div class="submit">
        <button type="button" class="btn btn-warning">Submit</button>
        <button type="button" class="btn btn-secondary Secondary">Secondary</button>
      </div>

    </form>
  </div>
  </div>
    </>
    );
}

export default Login;
